import { Food } from "../models/Food";
import { TestListElementBox } from "../styles/OrderTrans";
import { SerifTextS } from "../styles/TextStyles";

export const SummaryList = ({ data }: any) => {
  return (
    <>
      {data.map(() => (
        <TestListElementBox>
          <SerifTextS>{data[0].name}</SerifTextS>
          <SerifTextS>x{data[0].amount}</SerifTextS>
          <SerifTextS>{data[0].price}</SerifTextS>
        </TestListElementBox>
      ))}
    </>
  );
};
